import { BrowserRouter as Router, Routes, Route, Link, NavLink } from 'react-router-dom';
import Urunler from './pages/Urunler';
import UrunEkle from './pages/UrunEkle';
import './index.css';

function App() {
  return (
    <div className="App">
      <Router>
        <nav>
          <NavLink exact activeClassName="active" to="/">Ürünler</NavLink>
          <Link activeClassName="active" to="urun-ekle">Ürün Ekle</Link>
        </nav>

        <ul>
            <li><NavLink exact activeClassName="active" to='/' >Home</NavLink></li>
            <li><NavLink activeClassName="active" to='/about'>About</NavLink></li>
            <li><NavLink activeClassName="active" to='/service/inner'>Service</NavLink></li>
        </ul> 

        <Routes>
          <Route path="/" element={<Urunler />} />
          <Route path="urun-ekle" element={<UrunEkle />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
